-- state
--
DROP TABLE IF EXISTS work_order_pro.state;

-- Create Table
CREATE TABLE state
(
  state_code  CHAR(2)      NOT NULL  COMMENT 'State Code'
 ,state_name  VARCHAR(15)  NOT NULL  COMMENT 'State Name'

 ,PRIMARY KEY (state_code)
)
COMMENT = 'State'
;

