-- product_type
--
DROP TABLE IF EXISTS work_order_pro.product_type;

-- Create Table
CREATE TABLE product_type
(
  product_type_code  CHAR(1)     NOT NULL  COMMENT 'Product Type Code'
 ,product_type_desc  VARCHAR(9)  NOT NULL  COMMENT 'Product Type Desc'

 ,PRIMARY KEY (product_type_code)
)
COMMENT = 'Product Type'
;

