-- work_order
--
DROP TABLE IF EXISTS work_order_pro.work_order;

-- Create Table
CREATE TABLE work_order
(
  work_order_number       INTEGER       NOT NULL                                                          COMMENT 'Work Order Number'
 ,date_ordered            DATE          NOT NULL                                                          COMMENT 'Date Ordered'
 ,work_order_status_code  CHAR(2)       NOT NULL                                                          COMMENT 'Work Order Status Code'
 ,customer_name           VARCHAR(50)   NOT NULL                                                          COMMENT 'Customer Name'
 ,customer_address_1      VARCHAR(50)   NOT NULL                                                          COMMENT 'Customer Address 1'
 ,customer_address_2      VARCHAR(50)   NOT NULL  DEFAULT ''                                              COMMENT 'Customer Address 2'
 ,customer_state          CHAR(2)       NOT NULL                                                          COMMENT 'Customer State'
 ,customer_city           VARCHAR(25)   NOT NULL                                                          COMMENT 'Customer City'
 ,customer_zip            CHAR(5)       NOT NULL                                                          COMMENT 'Customer Zip'
 ,customer_zip_extension  CHAR(4)                                                                         COMMENT 'Customer Zip Extension'
 ,customer_phone_number   CHAR(10)                                                                        COMMENT 'Customer Phone'
 ,customer_email          VARCHAR(200)                                                                    COMMENT  'Customer Email'
 ,date_scheduled          DATE                                                                            COMMENT 'Date Scheduled'
 ,technician_code         CHAR(6)       NOT NULL                                                          COMMENT 'Technician Code'
 ,date_completed          DATE                                                                            COMMENT 'Date Completed'
 ,date_added              DATETIME      NOT NULL  DEFAULT CURRENT_TIMESTAMP                               COMMENT 'Date Added'
 ,date_last_updated       DATETIME      NULL      DEFAULT CURRENT_TIMESTAMP  ON UPDATE CURRENT_TIMESTAMP  COMMENT 'Date Last Updated'

 ,PRIMARY KEY (work_order_number)
)
COMMENT = 'Work Order'
;

ALTER TABLE work_order
	ADD CONSTRAINT work_order_work_order_status_fk
	FOREIGN KEY    (work_order_status_code)
	REFERENCES     work_order_status (work_order_status_code)
	ON DELETE RESTRICT
	ON UPDATE RESTRICT;

ALTER TABLE work_order
	ADD CONSTRAINT work_order_technician_fk
	FOREIGN KEY    (technician_code)
	REFERENCES     technician (technician_code)
	ON DELETE RESTRICT
	ON UPDATE RESTRICT;

