-- work_order_detail
--
DROP TABLE IF EXISTS work_order_pro.work_order_detail;

-- Create Table
CREATE TABLE work_order_detail
(
  work_order_number  INTEGER        NOT NULL                                                          COMMENT 'Work Order Number'
 ,sku_code           CHAR(6)        NOT NULL                                                          COMMENT 'SKU Code'
 ,quantity           INTEGER        NOT NULL                                                          COMMENT 'Quantity'
 ,unit_cost          DECIMAL(11,4)  NOT NULL                                                          COMMENT 'Unit Cost'
 ,taxable            BIT                                                                              COMMENT 'Taxable'
 ,tax                DECIMAL(11,4)  NOT NULL  DEFAULT 0                                               COMMENT 'Tax'
 ,date_added         DATETIME       NOT NULL  DEFAULT CURRENT_TIMESTAMP                               COMMENT 'Date Added'
 ,date_last_updated  DATETIME                 DEFAULT CURRENT_TIMESTAMP  ON UPDATE CURRENT_TIMESTAMP  COMMENT 'Date Last Updated'

 ,PRIMARY KEY (work_order_number, sku_code)
)
COMMENT = 'Work Order Detail'
;

ALTER TABLE work_order_detail
	ADD CONSTRAINT work_order_detail_work_order_fk
	FOREIGN KEY    (work_order_number)
	REFERENCES     work_order (work_order_number)
	ON DELETE RESTRICT
	ON UPDATE RESTRICT;

ALTER TABLE work_order_detail
	ADD CONSTRAINT work_order_detail_product_fk
	FOREIGN KEY    (sku_code)
	REFERENCES     product (sku_code)
	ON DELETE RESTRICT
	ON UPDATE RESTRICT;

